import React from 'react';
import {Button} from 'antd'
import {Container} from './style';

export default function Painel({btns}){
    return(
        <Container>
            <nav>
                {btns.map((btn)=>{
                    <Button>{btn}</Button>
                })}
            </nav>
        </Container>
    );
}
